  <meta charset="utf-8">
  <meta name="viewport" 
        content="width=device-width,
                 initial-scale=1,
                 shrink-to-fit=no">
  <title>
    ItherioMC Character Map
  </title>
  
  <style>
      body {
        background-color: #01263f !important;
      }
      .container {
        max-width: 55rem;
      }
      .th-inner .text-success { /* see line 88 ;[ */
        color: #357abb !important;
      }
      td, th {
        text-align: center;
        color: #FFFFFF;
        border-color: #165876 !important;
      }
      .arial {
        font-family: Arial, Helvetica, sans-serif;
        font-size: 1.5em;
      }
      .search-input.search-input {
        border-color: #01263f;
        background-color: #0e384b;
      }
      .page-link.page-link {
        color: #357abb;
      }
      .page-link.page-link, .dropdown-toggle.dropdown-toggle {
        background-color: #0e384b;
        border: #01263f;
      }
      .page-item.active .page-link {
        background-color: #1a688b !important;
      }
      .pagination-info, .page-list {
        color: #357abb;
      }
      h7 {
        font-size: 0.7rem;
      }


      /* Scrollbar from cssportal.com | I'm not great with colours ;[ */
      *{scrollbar-width:thin;scrollbar-color:#404BB4 #0E384B}*::-webkit-scrollbar{width:10px;width:10px}*::-webkit-scrollbar-track{border-radius:4px;background-color:#0E384B}*::-webkit-scrollbar-track:hover{background-color:#0B3243}*::-webkit-scrollbar-track:active{background-color:#134D66}*::-webkit-scrollbar-thumb{border-radius:4px;background-color:#404BB4}*::-webkit-scrollbar-thumb:hover{background-color:#254DB7}*::-webkit-scrollbar-thumb:active{background-color:#254DB7}

</head>
<body>
  <div class="container">
    <h1 class="text text-warning text-center">
      ItherioRP Resources
    </h1>
    <h6 class="text text-success text-center">
      UNICODE characters mapped to resource pack customizations.
    </h6>
    <h6 class="text text-info text-sm-center">
      Copy the unicode character from the table to use the corresponding image with the ItherioRP resource pack.
    </h6>
      <table class="table-striped border-success" 
      data-pagination="true"
      data-pagination-h-align="left"
      data-pagination-detail-h-align="right"
      data-page-size="50"
      data-page-list="[25, 50, 100, All]"
      data-search="true"
      data-regex-search="true">
        <thead>
          <tr>
            <th data-field="chars" data-formatter="unicode" data-width="5.62" data-width-unit="rem">
              <span class="text-success"> <!-- idk why, I'll fix later -->
                Unicode Character
              </span>
            </th>
            <th data-field="_hex" data-width="5.62" data-width-unit="rem">
              <span class="text-success">
                Hex
              </span>
            </th>
            <th data-field="file" data-formatter="images" data-width="7.5" data-width-unit="rem">
              <span class="text-success">
                File 
              </span>
            </th>
          </tr>
        </thead>
      </table>
  </div>

  <script src=
"https://code.jquery.com/jquery-3.3.1.min.js">

"https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.7/umd/popper.min.js">

    function images(value, row) {
      var icon = row.file
      return '<img src="assets' + icon + '" style="margin:auto;display:block;max-height:3.125rem;">' +
      '<p style="font-size:0.7rem;">' + row.file + '</p>'
    }

    function unicode(value, row) {
      var uni = row.chars
      return '<p class="arial">' + uni + '</p>'
    }
